// src/components/NavBar.js
import React from 'react';
import { Link } from 'react-router-dom';
import { useTranslation } from 'react-i18next';
import './NavBar.css';
import dubaiFlag from '../pages/images/dubai-flag.png';

function NavBar({ changeLanguage }) {
  const { t } = useTranslation();

  return (
    <nav className="navbar">
      <h1>{t('welcome')}</h1>
      <ul>
        <li><Link to="/">{t('home')}</Link></li>
        <li><Link to="/services">{t('services')}</Link></li>
        <li><Link to="/real-estate">{t('realEstate')}</Link></li>
        <li><Link to="/medical-vacation">{t('medicalVacation')}</Link></li>
        <li><Link to="/business-solutions">{t('businessSolutions')}</Link></li>
        <li><Link to="/about-us">{t('aboutUs')}</Link></li>
        <li><Link to="/contact">{t('contact')}</Link></li>
        <li>
          <img src={dubaiFlag} alt="Dubai Flag" className="flag-icon" />
        </li>
        <li>
          <button className="language-button" onClick={() => changeLanguage('ar')}>Arabic</button>
        </li>
        <li>
          <button className="language-button" onClick={() => changeLanguage('en')}>English</button>
        </li>
      </ul>
    </nav>
  );
}

export default NavBar;
